// ShareMarketChart.js

import React from 'react';
import styled from 'styled-components';

const ChartContainer = styled.div`
  background-color: black; /* Black background */
  padding: 20px;
`;

const ChartHeading = styled.h2`
  color: yellow; /* Bright yellow color */
`;

const StyledSVG = styled.svg`
  path {
    stroke: red; /* Bright red color for graph */
  }

  text {
    fill: yellow; /* Bright yellow color for axis labels */
  }
`;

function ShareMarketChart({ width, height }) {
  return (
    <ChartContainer>
      <ChartHeading>Share Market Chart</ChartHeading>
      <StyledSVG width={width} height={height}>
        {/* Add chart elements */}
        {/* For example: */}
        {/* <path d="M0,0 L50,50" /> */}
        {/* <text x="10" y="20">Label</text> */}
      </StyledSVG>
    </ChartContainer>
  );
}

export default ShareMarketChart;
